import { StyleSheet } from "react-native";
const style = StyleSheet.create({
    card: {
        backgroundColor: "#eaeaea",
        paddingLeft: 10,
    },
    cardTop: {
        // display: "flex",
        justifyContent: "space-around",
    },
    cardBody: {
        display: "flex",
        justifyContent: "space-around",
    },
});

export default style;
